Introduction
ncloud
The NAVER Cloud Platform(https://www.ncloud.com/) Library for Node.jshttps://www.npmjs.com/package/ncloudCurrently, this package supports geolocation only.... The other functions are unstable...
Author
Gyubeom Choi mosfet1kg@gmail.com
Installing Dependencies
$ npm install ncloud
or
$ yarn add ncloud
Creating Instance
ES5
var ncloud = require('ncloud');
var client = ncloud.createClient({
    oauth_consumer_key:'%YOUR_CONSUMER_KEY%',
    oauth_consumer_secret:'%YOUR_CONSUMER_SECRET%'
});

ES6 or above
import * as ncloud from 'ncloud';

const client = ncloud.createClient({
    oauth_consumer_key:'%YOUR_CONSUMER_KEY%',
    oauth_consumer_secret:'%YOUR_CONSUMER_SECRET%'
});

Others
ncloud supports type definitions. It is readily available in typescript.

